class Solution:
    global res
    res=[]
    def permute(self,s):

        def _backtrace(s,track):
            if len(track)==len(s):
                res.append(track)
                return
            else:
                for char in s:
                    if char in track:
                        continue

                    track+=char
                    _backtrace(s,track)
                    track=track[0:-1]

        track = ""
        _backtrace(s,track)
        return res

a=Solution()
s='acv'
print(a.permute(s))


res=[]
def permute(nums):
    def _backtrace(s,track):
        if len(track)==len(s):
            res.append(track)
            return
        else:
            for n in nums:
                if n in track:
                    continue
                track.append(n)
                _backtrace(s,track)
                track=track[0:-1]

    track = []
    _backtrace(s,track)
    return res
a=[1,2,3,4,6]
print(permute(a))




